// src/pages/FleetManagement.jsx
import React, { useState } from 'react';
import AddTruckForm from '../CRUD/AddTruck';

const FleetManagement = () => {
  const [showForm, setShowForm] = useState(false);
  const [fleet, setFleet] = useState([]);

  const handleAddTruck = (newTruck) => {
    setFleet([...fleet, newTruck]);
    setShowForm(false);
  };

  return (
    <div className="fleet-management">
      <h2>Fleet Management</h2>
      <button onClick={() => setShowForm(true)}>Add New Truck</button>

      {showForm && (
        <AddTruckForm
          onAdd={handleAddTruck}
          onCancel={() => setShowForm(false)}
        />
      )}

      <div className="fleet-list">
        {fleet.map((truck, index) => (
          <div key={index} className="truck-card">
            <p><strong>Plate:</strong> {truck.plateNumber}</p>
            <p><strong>Model:</strong> {truck.model}</p>
            <p><strong>Capacity:</strong> {truck.capacity} L</p>
            <p><strong>Location:</strong> {truck.location}</p>
            <p><strong>Status:</strong> {truck.status}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default FleetManagement;
